import React from "react";
import { render } from "react-dom";
import Highcharts from "highcharts";
import HighchartsReact from "highcharts-react-official";
import highchartsMap from "highcharts/modules/map";
import proj4 from "proj4";
import mapDataIE from "./topo_fm";
import mapData_guy from "./topo_guy";
import mapData_tah from "./topo_tahiti_moorea";
import data2 from "./data"

highchartsMap(Highcharts); // Initialize the map module

if (typeof window !== "undefined") {
  window.proj4 = window.proj4 || proj4;
}

const mapOptions = {
  chart: {
    map: "countries/fr/fr-all"
  },
  title: {
    text: " "
  },
  credits: {
    enabled: false
  },
  mapNavigation: {
    enabled: false
  },
  tooltip: {
    headerFormat: "",
    pointFormat: "lat: {point.lat}, lon: {point.lon}"
  },
  series: [
    {
      // Use the gb-all map with no data as a basemap
      name: "Basemap",
      mapData: mapDataIE,
      borderColor: "#A0A0A0",
      nullColor: "rgba(200, 200, 200, 0.3)",
      showInLegend: false
    },
    {
      // Specify points using lat/lon
      type: "mapbubble",
      name: "Locations",
      color: "#4169E1",
      data:[{keyword:"Amb\u00e9rieu-en-Bugey",z:147.0,"latitude":45.9608475114,"longitude":5.3729257777},
            {keyword:"Bellignat",z:103.0,"latitude":46.2373497134,"longitude":5.6360052884},
            {keyword:"Valserh\u00f4ne",z:35.0,"latitude":46.1067901755,"longitude":5.8320273646},
            {keyword:"Bourg-en-Bresse",z:2596.0,"latitude":46.2051520382,"longitude":5.246021255},
            {keyword:"Ferney-Voltaire",z:117.0,"latitude":46.2519789243,"longitude":6.108264038},
            {keyword:"Plateau d'Hauteville",z:170.0,"latitude":45.9696520061,"longitude":5.5762726178}] ,
      cursor: "pointer",
      point: {
        events: {
          click: function() {
            console.log(this.keyword);
          }
        }
      }
    }
  ]
};

const mapOptions_guy = {
  chart: {
    map: "countries/fr/fr-all"
  },
  title: {
    text: " "
  },
  credits: {
    enabled: false
  },
  mapNavigation: {
    enabled: false
  },
  tooltip: {
    headerFormat: "",
    pointFormat: "lat: {point.lat}, lon: {point.lon}"
  },
  series: [
    {
      // Use the gb-all map with no data as a basemap
      name: "Basemap",
      mapData: mapData_guy,
      borderColor: "#A0A0A0",
      nullColor: "rgba(200, 200, 200, 0.3)",
      showInLegend: false
    },
    {
      // Specify points using lat/lon
      type: "mapbubble",
      name: "Locations",
      color: "#4169E1",
      data: [ { z: 10, keyword: "Paris", lat: 48.856614, lon: 2.3522219 },
              { z: 5, keyword: "Cayenne", lat: 4.93, lon:-52.33 },
              { z: 8, keyword: "Papara", lat: -17.7583, lon: -149.50817 }
            ],
      cursor: "pointer",
      point: {
        events: {
          click: function() {
            console.log(this.keyword);
          }
        }
      }
    }
  ]
};

const mapOptions_tah = {
  chart: {
    map: mapData_tah
  },
  title: {
    text: " "
  },
  credits: {
    enabled: false
  },
  mapNavigation: {
    enabled: false
  },
  tooltip: {
    headerFormat: "",
    pointFormat: "lat: {point.lat}, lon: {point.lon}"
  },
  series: [
    {
      // Use the gb-all map with no data as a basemap
      name: "Basemap",
      mapData: mapData_tah,
      borderColor: "#A0A0A0",
      nullColor: "rgba(200, 200, 200, 0.3)",
      showInLegend: false
    },
    {
      // Specify points using lat/lon
      type: "mapbubble",
      name: "Locations",
      color: "#4169E1",
      data: [ { z: 10, keyword: "Paris", lat: 48.856614, lon: 2.3522219 },
      { z: 5, keyword: "Cayenne", lat: 4.93, lon:-52.33 },
      { z: 8, keyword: "Papara", lat: -17.7583, lon: -149.50817 }
      ],
      cursor: "pointer",
      point: {
        events: {
          click: function() {
            console.log(this.keyword);
          }
        }
      }
    }
  ]
};



const App = () => (
  <div>
    <HighchartsReact
      constructorType={"mapChart"}
      highcharts={Highcharts}
      options={mapOptions}
    />
    <HighchartsReact
      constructorType={"mapChart"}
      highcharts={Highcharts}
      options={mapOptions_guy}
    />
    <HighchartsReact
      constructorType={"mapChart"}
      highcharts={Highcharts}
      options={mapOptions_tah}
    />
  </div>
);

export default App
